import Link from 'next/link';

const Display = (props) =>{
    if(props.data.foods)
    return (
        <ul>
            {props.data.foods ? props.data.foods.map((food) => (
                <li key={food.fdcId}>
                    <Link href="/p/[id]" as={`/p/${food.fdcId}`}>
                        <a>
                        {food.fdcId} - {food.brandOwner}
                        </a>
                    </Link>
                </li>
            )) : null}
        </ul>
    )
}

export default Display;
